// Imports
import React, { Component } from "react";
import { Route } from "react-router";
import Header from "./components/Header.js";
import Plants from "./components/Plants.js";
import { getAllPlants } from "./helper/helpers";

import "./custom.css";

// App
export default class App extends Component {
  constructor(props) {
  state = {
    plants: [],
  };
  }

  getAllPlants() {
    fetch('https://localhost:5001/api/plants')
    .then(res => res.json())
      .then(plants => {this.setState({ plants: plants })});
  };

  render() {
    var {plants} = this.state
    return (
      <div>
        <section className="nav">
          <Header />
        </section>
        <section>
          <Plants plants={this.state.plants.name} />
        </section>
      </div>
    );
  }
}
